import React from 'react';
import './Datathon.css';
import IconButton from './../../components/IconButton.js'

function Datathon() {
    return (
        <div class="datathon">
            <div class="heading">
                <p class="title"> Blueprint Datathon </p>
                <p class="subtitle"> Subtitle goes here </p>
                <div class="icon-row">
                    <IconButton link="https://devpost.com/software/covid-19-health-disparities" icon=<i class="fa link"/> />
                    <IconButton link="https://devpost.com/software/covid-19-health-disparities" icon=<i class="fa fa-dev"/> />
                </div>

            </div>
            <div class="content">
                <p class="text"> Text </p>
            </div>
        </div>
    );
}

export default Datathon;
